Analyses:
  ATLAS_1404_2500:
    Summary: Search for supersymmetry at sqrt(s)=8 TeV in final states with jets and  two same-sign leptons or three leptons with the ATLAS detector
    Experiment: ATLAS
    Collider: LHC8
    Year: 2014
    Description: A search for strongly produced supersymmetric particles is conducted using signatures involving multiple energetic jets and either two isolated leptons ($e$ or $\mu$) with the same electric charge, or at least three isolated leptons. The search also utilises jets originating from b-quarks, missing transverse momentum and other observables to extend its sensitivity. The analysis uses a data sample corresponding to a total integrated luminosity of 20.3 fb$^{-1}$ of $\sqrt{s} =$ 8 TeV proton-proton collisions recorded with the ATLAS detector at the Large Hadron Collider in 2012. No deviation from the Standard Model expectation is observed. New or significantly improved exclusion limits are set on a wide variety of supersymmetric models in which the lightest squark can be of the first, second or third generations, and in which R-parity can be conserved or violated.
